import React from 'react';
import DescriptionSharpIcon from '@mui/icons-material/DescriptionSharp';

const Header = () => {
    return (<>
    <h1>WriteYourNotesBuddy</h1>
    <br />
    <form >
        <h2>Title</h2>
        <input type="text" />
        <textarea name="notes" id="notes" cols="30" rows="10"></textarea>
    </form>
    </>);
};
export default Header;
